import React from "react";
import {optionalMainDivStyle, optionalDivStyle, signInButton,CreateAccountWhiteBgStyleHover, CreateAccountWhiteBgStyle, divStyle, textFieldStyles, textFieldErrorStyles} from "./componentsStyles";

function OptionalDiv() {
    return (
      <div style={optionalMainDivStyle}>
        <div style={optionalDivStyle}></div>
        <p style={{ padding: "10px" }}>Don't have an account?</p>
        <div style={divStyle}></div>
      </div>
    );

}

function EmailTextFieldInput(error, errorMessage) {
  return (
    <div>
      <input
        type="email"
        id="email"
        name="emailAddress"
        style={error? textFieldErrorStyles: textFieldStyles}
        placeholder={"Email Address"}

        required
      />

      {error && <p style={{color: "red", margin: '5px 0 0 0'}}>{errorMessage}</p>}
      
    </div>
  );
}

function PasswordTextFieldInput(error, errorMessage) {
  return (
    <div>
      <input
        type="password"
        id="password"
        name="password"
        style={error? textFieldErrorStyles: textFieldStyles}
        placeholder="Password"
        

        required minLength={6}
      />
      
      {error && <p style={{color: "red", margin: '5px 0 0 0'}}>{errorMessage}</p>}
    </div>
    
  );
}

function SignInButton() {
  return (
    <div>
      <button style={signInButton}>
        <b>Create Account</b>
      </button>
    </div>
  );
}


